import React, { useEffect } from "react";


const app = express();

// Middleware to enable CORS
app.use((req, res, next) => {
  res.setHeader('Access-Control-Allow-Origin', 'http://localhost:3001'); // Allow requests from this origin
  res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE'); // Allow the specified methods
  res.setHeader('Access-Control-Allow-Headers', 'Content-Type, Authorization'); // Allow the specified headers
  next();
});

function Home() {

    useEffect(()=>{
         fetch('http://localhost:3000/posts')
         .then((response)=>{
            console.log(response)
         })
         .catch((e)=>{
            console.log(e);
         })
    },[])

  return (
    <div><h1>homepage</h1></div>
  )
}
export default Home;
